// компонент для тестирования функционала

function DevelopTest() {


    return (
        <div className='develop-test'>
            <button className='dev_button-add-participant'>Добавить участника</button>
            <button className='dev_button-remove-participant'>Удалить участника</button>
            <button className='dev_button-reset-timer'>Перезапустить таймер</button>
        </div>
    )
}

export default DevelopTest;
